import { BrowserRouter as Router, Route } from 'react-router-dom'

import Footer from './components/Footer'
import Header from './components/Header'

import HomeScreens from './sreens/HomeScreens'
import ProductScreen from './sreens/HomeScreens'
function App() {
  return (
    <Router>

      <Header></Header>
      <main className="py-3">
        <Container>
        <Route path='/home' component={HomeScreens} exact/>
        </Container>
      </main>
      <Footer></Footer>

    </Router>
  );
}

export default App;
